<style> /* set the CSS */

.node rect {
    stroke: #333;
    stroke-width: 1.5px;
    fill: #fff;
}

path {
    stroke: steelblue;
    stroke-width: 4px;
    fill: none;
}

g[fstLine="false"] > ellipse {
    stroke: gray;
    fill: lightgray;
}


g[bypass="true"] > path {
    stroke-dasharray: 5, 5;
}

.axis path,
.axis line {
    fill: none;
    stroke: grey;
    stroke-width: 2px;
    shape-rendering: crispEdges;
}

div.tooltip {
    position: absolute;
    text-align: center;
    padding: 1px;
    font: 10px sans-serif;
    background: lightsteelblue;
    border: 0px;
    border-radius: 2px;
}

    function renderTable(data) {
        data = data["hover"]

        // Extracting the keys.
        var keys = new Set();
        for (var i = 0; i < data.length; i++) {
            var obj = data[i];
            for (var k in obj) {
                keys.add(k);
            }

        var table = document.createElement("table");
        var header = document.createElement("tr");
        table.appendChild(header);

            var th = document.createElement("th");
            var text = document.createTextNode(keys[k]);
            header.appendChild(th);
            th.appendChild(text);
        }

            var obj = data[i];
            var tr = document.createElement("tr");
            table.appendChild(tr);
            for (var k in keys) {
                var attr = obj[keys[k]];
                if (attr == undefined)
                    attr = "";
                var td = document.createElement("td");
                td.insertAdjacentHTML('beforeend', attr);
                tr.appendChild(td);

            }
        }
        return table
    }

    d3.select("#graphContainer")
        .graphviz()
        .fade(false)
        .height(1600)
        .width(2300)
        .renderDot(dotdata)
        .on("end", function () {
            var svg = d3.select("#graphContainer");
            var hoverElements = svg.selectAll(".edge,.node");

            // Append annotations to svg
            for (svgid in jsondata) {
                var annotations = jsondata[svgid]["svg"];
                for (annotation in annotations) {
                    d3.selectAll("#" + svgid).attr(annotation, annotations[annotation]);
                }
            }

            hoverElements.on("mouseover", function (d) {
                div.transition()
                    .duration(100)
                    .style("opacity", 0);
                div.transition()
                    .duration(100)
                    .style("opacity", .9);
                div.style("left", (d3.event.pageX + 30) + "px")
                    .style("top", (d3.event.pageY - 28) + "px")
                    .html("")
                    .node()
                    .appendChild(renderTable(jsondata[d3.event.target.parentElement.id])
                    );
            });
        });

</script>
